    if (big) {
      return (
        <div className="maindiv">
          {newtext}
        </div>
      );
    } else {
      return (
        <div className="maindiv">
          {newtext}
        </div>
      );
    }
  }

  return (
    renderSize(this.props.bignotsmall) 
  );
}

export default App;
